window.bookSummaryJSON = "<p><b>The Messenger must prepare for war. </b></p> <p>With the Archetype damaged, Dash and his crew will need more than a quick fix to prepare for what's coming.&nbsp;</p> <p>A secret facility known only as the Forge lies in cold sleep, built by the Unseen for the greatest war in history. Dash has no idea what awaits him there, but he hopes to find some kind of advantage in the war that is to come.&nbsp;</p> <p>Meanwhile, on a distant world, an ancient order of monks protects a long-buried secret. They have guarded it for centuries, all in the hope that someday the Messenger might come and relieve them of their task.&nbsp;</p> <p>Dash has answered that call...and he will not be denied.</p>"; 
